import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Slider from 'react-slick';

const Home = () => {
  const token = localStorage.getItem('token');
  console.log(token);

  // Estado para almacenar la lista de usuarios
  const [users, setUsers] = useState([]);
  const [reports, setReports] = useState([]);

  // FunciÃ³n para obtener los usuarios desde el API
  const fetchUsers = async () => {
    try {
      const response = await axios.get(
        'https://ujed-api.onrender.com/api/users?order_by=created_at&order=desc&limit=5',
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      setUsers(response.data);
    } catch (error) {
      console.error('Error al obtener usuarios:', error);
    }
  };

  const fetchReports = async () => {
    try {
      const response = await axios.get(
        'https://ujed-api.onrender.com/api/reports?limit=10&offset=0&order=asc',
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      setReports(response.data);
    } catch (error) {
      console.error('Error al obtener reportes:', error);
    }
  };

  // Llamamos a fetchUsers y fetchReports al cargar el componente
  useEffect(() => {
    fetchUsers();
    fetchReports();
  }, []); // La lista de depend

  // Llamamos a fetchUsers al cargar el componente

  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <div className="dashboard-container">
    <h1>Dashboard</h1>
    <div className="user-list">
      <h2>Lista de Usuarios</h2>
      <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Nombre</th>
              <th>Apellido</th>
              <th>Email</th>
              <th>Roles</th>
              <th>Creado</th>
              <th>Actualizado</th>
            </tr>
          </thead>
          <tbody>
            {users.map(user => (
              <tr key={user.id}>
                <td>{user.id}</td>
                <td>{user.name}</td>
                <td>{user.last_name}</td>
                <td>{user.email}</td>
                <td>{user.roles.join(', ')}</td>
                <td>{new Date(user.created_at).toLocaleString()}</td>
                <td>{new Date(user.updated_at).toLocaleString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
    </div>
    <div className="report-list">
      <h2>Lista de Reportes</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>TÃ­tulo</th>
            <th>DescripciÃ³n</th>
            <th>Estado</th>
            <th>UbicaciÃ³n</th>
            <th>Usuario</th>
            <th>ImÃ¡genes</th>
            <th>Creado</th>
            <th>Actualizado</th>
          </tr>
        </thead>
        <tbody>
          {reports.map(report => (
            <tr key={report.id}>
              <td>{report.id}</td>
              <td>{report.title}</td>
              <td>{report.description}</td>
              <td>{report.status}</td>
              <td>{report.location}</td>
              <td>{report.user.name}</td>
              <td>
                {report.images.length > 0 && (
                  <Slider {...sliderSettings}>
                    {report.images.map(image => (
                      <div key={image.id}>
                        <img src={image.url} alt="Reporte" />
                      </div>
                    ))}
                  </Slider>
                )}
              </td>
              <td>{new Date(report.created_at).toLocaleString()}</td>
              <td>{new Date(report.updated_at).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  </div>
);
};

export default Home;
